import styled from "styled-components";

export default function Money({ money }) {
  const { value, description, type, date } = money;
  return (
    <Container>
      <LeftSide>
        <Date>{date}</Date>
        <Description>{description}</Description>
      </LeftSide>
      <RightSide>
        <Value type={type}>{value}</Value>
      </RightSide>
    </Container>
  );
}

const Container = styled.div`
  width: 80%;
  display: flex;
  flex-direction: row;
`;
